uint32_t walk(uint32_t inst) {
	uint32_t state = 1, key;
    int32_t dt;
    DFAState* curr;

    int shift = 32;
    while (shift > 0) {
        shift -= ALPHABET_RANK;
        curr = &delta[state];
        // unpack 10bit edge
        key  = (inst >> shift) & BIT_MASK(ALPHABET_RANK);
        dt   = (((uint32_t) curr->edges[key] << 2) | ((curr->lsb >> (key*2)) & 3)) - 512;
        // early out
        if (dt == 0) { return state; }
        state += dt;
    }
    return state;
}

